import React, { Component} from 'react';

export default class Task extends Component{

    render(){
        return (

            <div>
                {this.props.tareas.map( item =>
                     <p key={item.id} >{item.description } - 
                        {item.title} - 
                        {item.id} - 
                        {item.done}                               
                     </p>)}
                <input type="checkbox" ></input>
            </div>
        )}

}
